// export default Header;

import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';

function Header() {
  const clickStyle = { color: 'red' };

  return (
    <header>
      <Navbar bg="light" expand="lg">
        <meta
          name="viewport"
          content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=0"
        />
        <link
          rel="stylesheet"
          href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0-beta3/css/all.min.css"
        />
        <div className="inner">
          <Navbar.Brand as={NavLink} to="/react_portfolio">
            Branden Min
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link
                as={NavLink}
                to="/react_portfolio"
                exact
                activeStyle={clickStyle}
              >
                About
              </Nav.Link>
              <Nav.Link
                as={NavLink}
                to="/Projects"
                exact
                activeStyle={clickStyle}
              >
                PROJECTS
              </Nav.Link>
              <Nav.Link
                as={NavLink}
                to="/Experiences"
                exact
                activeStyle={clickStyle}
              >
                EXPERIENCES
              </Nav.Link>
              <Nav.Link
                as={NavLink}
                to="/Skills"
                exact
                activeStyle={clickStyle}
              >
                SKILLS
              </Nav.Link>
              <Nav.Link onClick={() => window.open('/react_portfolio/BrandenMin.pdf', '_blank')}>
                CV
              </Nav.Link>
            </Nav>
            <Nav>
              <Nav.Link
                as={NavLink}
                to="/Contact"
                exact
                activeStyle={clickStyle}
              >
                Contact
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </div>
      </Navbar>
    </header>
  );
}

export default Header;
